// Home.tsx
import React, {useState} from 'react';
import About from './About';
import Main from '../Main';
import { render } from '@testing-library/react';

function Home() {
    const [currentPage, setPage] = useState("");

    const renderPage = () => {
        switch(currentPage){
            case "about":
                return <About />;
            case "main":
                return <Main />;
            default:
               return <>
                    <h2>ホームページ</h2>
                    <h1>斎田だよおお！！！</h1>
                    <button onClick={() => setPage("main")}>メイン</button>
                    <button onClick={() => setPage("about")}>アバウト</button>
                </>
        }
    }

    return (
        <>
            {renderPage()}
        </>
    );
}

export default Home;
